If 10,000 B.C. had intended to be a comedy full of low-brow humor, it might have looked like this offering from National Lampoon. Adam Rifkin (the screenwriter behind UNDERDOG) directs, writes, and stars as Ishbo, a caveman who isn't satisfied with his low-tech life. His friends and family hate his practical inventions, while he lusts after the unattainable Fardart (HEROES' Ali Larter). HOMO ERECTUS is filled with the type of jokes that National Lampoon's fans adore, and it features stars such as David Carradine, Talia Shire, Gary Busey, and Ron Jeremy.



